function registerCustomFont(doc, fontName, style, ttfFilename, base64String) {
  if (!doc || typeof doc.addFileToVFS !== "function") {
    console.error("doc tidak valid untuk register font!");
    return;
  }
  doc.addFileToVFS(ttfFilename, base64String);
  doc.addFont(ttfFilename, fontName, style);
}
